import React, { Component } from 'react';
import ViewObject from "../../util/ViewObject";
import TableCell from "@mui/material/TableCell";
import TableRow from "@mui/material/TableRow";
import {JSONtoStringifyYAML} from "../../util/util";

class Dataset extends Component {
    constructor(props) {
        super(props);
        this.state = {
            datasetOriginalJSON : this.props.datasetOriginalJSON,

            name: this.props.datasetOriginalJSON.datasetConfig.name,
            datasetStatusJSON: this.props.datasetOriginalJSON.status,
        };
    }

    render() {
        const {name, datasetStatusJSON} = this.state
        const {handleSendRequest} = this.props

        return (
            <TableRow
                key={name}
                sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
            >
                <TableCell component="th" scope="row">{name}</TableCell>
                <TableCell align="right">{datasetStatusJSON.phase}</TableCell>
                <TableCell align="right">{datasetStatusJSON.boundedAlluxioCluster || '-'}</TableCell>
                <TableCell align="right">
                    <ViewObject
                        objectKind='Dataset'
                        objectName={name}
                        objectConfigString={JSONtoStringifyYAML(datasetStatusJSON)}
                        objectStatusString={JSONtoStringifyYAML(datasetStatusJSON)}
                        handleSendRequest={handleSendRequest}
                    />
                </TableCell>
            </TableRow>
        );
    }
}

export default Dataset
